import React from "react";
import './sidebar.css'
import { 
    Container,
    Row, 
    Col } from 'react-bootstrap';

function Sidebar() {
    return (
        <div>
            <Container>
                <Row>
                    <Col lg="2">
                        <h1>Home</h1>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Sidebar
